        '<div>\n\t<ul></ul>\n</div>\n<ul>\n\t<li>Televizyon ve internetin çocukların hayatında daha fazla yer aldığı günümüzde çocuklarda bireysellik ve yalnızlık duygusu gelişmektedir.,\n\t\t<br />\n\t</li>\n\t<li>Yalnızlık duygusu onların mutsuz, huzursuz bir çocukluk geçirmesine ve zekâlarının beklenenin altında gelişmesine neden olmaktadır.\n\t\t<br />\n\t</li>\n\t<li>Oyun çocukların sosyalleşmesi, hayal gücünü geliştirmesi, farklı ve yaratıcı düşünme becerisini güçlendirmesi açısından oldukça faydalıdır.\n\t\t<br />\n\t</li>\n\t<li>\n\t\t<b style="box-sizing: border-box; font-weight: 700;">\n\t\t\t<i style="box-sizing: border-box;">Çoğu zaman yetişkinlerin bir şeye benzetemediği oyuncaklar çocukların hayal gücünü kullanması ile bir ev yada araba olabilir.</i>\n\t\t</b>\n\t\t<br />\n\t</li>\n\t<li>\n\t\t<b style="box-sizing: border-box; font-weight: 700;">Ahşap Yapı Blokları ile</b>\n\t\t<b style="box-sizing: border-box; font-weight: 700;">;\n\t\t\t<span>&nbsp;</span>\n\t\t</b>tüm aile bireyleri beraber zaman geçirecek, ortak bir şeyler yapmanın mutluluğunu yaşayacak ve çocukların zekâ gücü desteklenecektir.\n\t\t<br />\n\t</li>\n\t<li>\n\t\t<b style="box-sizing: border-box; font-weight: 700;">Ahşap Yapı Blokları ile</b>\n\t\t<b style="box-sizing: border-box; font-weight: 700;">;\n\t\t\t<span>&nbsp;</span>\n\t\t</b>hem sınırsız şekil, kule, bina veya yaratıcı şekiller, figürler yapılabilecek hem de denge, düşünme ve görme yetenekleri gelişecektir.\n\t\t<br />\n\t</li>\n\t<li>\n\t\t<b style="box-sizing: border-box; font-weight: 700;">NASIL OYNANIR?</b>\n\t\t<br />\n\t</li>\n\t<li>Çocuklar geometrik şekillerden oluşan ahşap blokları kullanarak&nbsp; şekiller, figürler oluştururlar. Şekilleri oluştururken çocuklar yönlendirilmemektedir. Çünkü yönlendirme çocuğun hayallerini sınırlandırmış olunacaktır.\n\t\t<br />\n\t</li>\n\t<li>Bu şekilleri oluştururken hayal güçlerini, dikkat ve konsantrasyonlarını ve psikomotor kas becerilerini kullanırlar. Çünkü yeni şekiller için hayal gücüne, şekilleri oluştururken düşmemesi için dikkat ve psikomotor becerilere ihtiyacı vardır.\n\t\t<br />\n\t</li>\n\t<li>\n\t\t<b style="box-sizing: border-box; font-weight: 700;">\n\t\t\t<u style="box-sizing: border-box;">Ahşap Yapı Bloklarının Çocuğa Faydaları:</u>\n\t\t</b>\n\t\t<br />\n\t</li>\n\t<li>Çocuğun kaslarına egemen olmasına ve duyu-hareket açısından gelişimine destekler.\n\t\t<br />\n\t</li>\n\t<li>Yeni bir şeyler oluşturmaya ve yaratıcı düşünmeye çocuğun beynini yönlendirir böylece zekâyı çalıştırır.\n\t\t<br />\n\t</li>\n\t<li>kutusunda yer alan ahşap bloklar geometrik şekillerden oluştuğu için çocuğun üçgen, kare, dikdörtgen gibi şekilleri tanımasına yardımcı olur.\n\t\t<br />\n\t</li>\n\t<li>Yapı, inşa, denge, dayanıklılık gibi bilim ve sayı içeren alanlarda zekânın aktif kullanılmasını destekler.\n\t\t<br />\n\t</li>\n\t<li>Çocukların hayal kurmasını sağlar böylece Duygusal Zekâsını (EQ) güçlendirir.\n\t\t<br />\n\t</li>\n\t<li>Çocuklarda el göz koordinasyonu geliştirmenin yanında,&nbsp;\n\t\t<b style="box-sizing: border-box; font-weight: 700;">yaratıcılık, denge, temel fizik becerileri, hayal gücü</b>&nbsp;geliştirici özelliği vardır.\n\t\t<br />\n\t</li>\n\t<li>Psikomotor kabiliyetleri ve el becerilerini geliştiren eğitici ve öğreticidir.\n\t\t<br />\n\t</li>\n</ul>\n<div>\n\t<br /></div>',
